    [],nt"num_tags": 6,nt"name": "sherburne-national-wildlife-refuge-annual-narrative-report-calendar-year-1995",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Sherburne
    National Wildlife Refuge summarizes Refuge activities during the 1995 calendar year.
    The report begins with a summary of the yearu2019s highlights and climatic conditions.
    Land acquisition is also covered. The report includes a planning section which discusses
    research and investigations. Refuge administration is outlined; information about
    personnel, youth programs, manpower programs, volunteer programs, funding, and safety
    is given. Habitat management is also covered. Subjects include wetlands, forests,
    grasslands, fire management, pest control, and private lands. The wildlife section
    of the report discusses endangered species, threatened species, waterfowl, marsh
    birds, waterbirds, game mammals, marking, and banding. The public uses of the Refuge
    described in this report include outdoor classrooms, interpretive exhibits, hunting,
    fishing, trapping, wildlife observation, and law enforcement. The equipment and
    facilities section of the report provides information about rehabilitation, major
    maintenance, equipment utilization/replacement, communication systems, and computer
    systems. Cooperative programs are provided at the end. Refuge brochures are attached.",nt"owner_org":
